INSERT INTO `rule` (`rule_id`, `rule_text`, `rule_created`) VALUES
(1, 'Vero unde eos similique vero vero recusandae placeat et ut aut id quibusdam explicabo eveniet corporis non culpa esse enim in est officia ratione illum non dignissimos velit perspiciatis fugiat doloribus voluptas aut quia rerum qui cupiditate pariatur illum adipisci dignissimos sunt vitae repellendus accusantium beatae ducimus saepe ab dolor porro cumque consequatur et possimus quia modi nam aut doloremque repellat qui doloribus excepturi ipsa non in quam perferendis consequatur officia deserunt suscipit voluptas nihil error magnam culpa atque atque et est fuga nisi qui ipsam natus consequuntur et aliquid non error autem eum dicta qui nihil eaque quidem ut excepturi necessitatibus ut aperiam esse qui labore inventore magnam modi ad sint ut est consequuntur nihil esse deserunt in in ea totam et aut velit facere sed qui qui omnis est est dolorem ut et voluptate doloribus porro porro recusandae ea laboriosam autem optio at deserunt tempore totam saepe rem similique commodi numquam quis perspiciatis consequatur eum inventore ullam nam est et nulla rerum hic atque quae non ut eaque libero officia provident voluptas libero sint quis aut ullam et suscipit iste eius porro voluptate sequi expedita quia repellendus et sunt dolor molestiae alias repudiandae totam quia voluptas est neque nesciunt explicabo nihil illum possimus quidem praesentium illo omnis dolorem velit hic porro et dolores aspernatur et debitis et quas ex qui et reiciendis neque nostrum id ut nisi libero voluptatem enim provident qui molestiae perspiciatis dolores consequatur ipsam mollitia qui explicabo iste.', '2022-12-09 23:05:31'),
(2, 'Provident aut atque iure beatae fuga placeat reiciendis ipsum facere et voluptatem praesentium laboriosam et reprehenderit autem ipsa corrupti aut blanditiis saepe doloremque rerum ut debitis hic ratione similique dolores blanditiis officia voluptates eligendi atque facilis vel eos nulla voluptatem sapiente itaque tenetur ut accusantium quod ad qui laudantium temporibus voluptates minima dolorum enim nulla aut ullam dolorem amet eligendi sapiente enim architecto itaque est sed cumque quam dolorem nemo illo explicabo voluptates ad eligendi aut autem tempora quos voluptatibus aspernatur ut nobis ea sint cumque incidunt ab non vitae odio accusantium odit sint placeat fugit perspiciatis itaque accusantium incidunt voluptas unde ut sed reiciendis optio et minima eos aperiam sapiente laudantium nulla assumenda et animi dolores mollitia aut qui cumque dolorum nesciunt explicabo consequatur quis quaerat inventore est explicabo quis cum et facere dolores mollitia et voluptatibus et quasi at laboriosam nostrum et adipisci quibusdam sapiente aut placeat voluptas reiciendis inventore nam sint quae et vel porro est sed nihil itaque qui delectus molestias earum aut magnam maxime atque magni fuga laudantium natus deleniti error rerum perferendis consequatur alias ea qui impedit reiciendis vel nemo qui nesciunt adipisci quia accusamus ut nulla placeat rerum ea placeat fugiat ut unde perspiciatis sed est ratione dolorem ipsum voluptas quam ut et provident eveniet quam ullam possimus.', '2022-12-09 23:05:31'),
(3, 'Praesentium accusantium autem nihil quis sequi iusto error unde at quia fugit ad error minus est et et sit quas iste nam ea provident error reiciendis numquam ut provident quae ea ipsum occaecati est quibusdam quibusdam illo vel nesciunt ut porro animi velit repudiandae blanditiis nobis quidem ratione dolor qui pariatur pariatur illo id incidunt laborum nisi doloremque consequuntur aspernatur illo cum id eius saepe neque nulla error quia et voluptas dolore consequatur et a est ad ea tenetur qui aut fugiat sed tempora nisi placeat minus molestiae quis qui alias enim dicta rerum incidunt reiciendis laudantium est minima ad non quod dolor rem iusto quis blanditiis dolores accusantium amet hic dicta quia alias vitae est ratione ullam dignissimos recusandae dolores in sit nostrum quia atque dolorem repudiandae quia a dolore nihil enim est dolorum aut nulla provident ad suscipit dolor et nihil eum quia.', '2022-12-09 23:05:31'),
(4, 'Iure quia iusto qui harum perspiciatis quasi molestiae placeat sed pariatur sit quo voluptatem omnis animi voluptas ipsam possimus adipisci perspiciatis et aut qui nihil et maxime illo maiores consequatur distinctio pariatur iure provident ullam sunt exercitationem molestiae quia voluptates veniam ea minus doloribus aut nesciunt consectetur saepe laborum ut sapiente illum similique ab accusantium et numquam et omnis aspernatur nemo fugiat recusandae inventore quis exercitationem ut suscipit excepturi eveniet quia eos rem iusto quae libero et omnis libero magni quia aspernatur deleniti laborum quas dignissimos qui reiciendis ut accusantium maxime quia reiciendis dolore est et non aut consequatur neque quo autem et asperiores consectetur explicabo at consequuntur sint voluptatum expedita in sit et voluptate aperiam amet earum molestiae voluptates error non nesciunt magni dolorem eos veniam cupiditate qui quis eum dignissimos qui aut aut ut cum qui nisi ratione beatae quas officia ab eius iste voluptas quibusdam doloremque qui sed vel temporibus ipsa architecto delectus quia id voluptas ut dicta in iure voluptas et corporis cumque voluptas voluptate ut et rerum consequatur rem sed dolor sed illo inventore enim dolorem ab id odit ut.', '2022-12-09 23:05:31'),
